import React, { useState } from 'react';
import '../styles/Register.css';
import axios from 'axios';

const StudentRegister = () => {
    const [formData, setFormData] = useState({
      name: '',
      rollNumber: '',
      dob: '',
      registerNumber: '',
      branch: '',
      yearOfEntry: '',
      fatherName: '',
      fatherOccupation: '',
      educationOccupation: '',
      familyBackground: '',
      parentPhoneNo: '',
      address: '',
      languagesKnown: '',
      guardianName: '',
      lastSchoolName: '',
      mediumOfInstructions: '',
      marksInPlusTwo: {
        maths: '',
        physics: '',
        chemistry: '',
        cutOff: '',
        quota: ''
      },
      counselorNames: {
        firstYear: '',
        secondYear: '',
        thirdYear: '',
        finalYear: ''
      }
    });
  
    const handleChange = (e) => {
      const { name, value } = e.target;
      setFormData({
        ...formData,
        [name]: value
      });
    };
  
    const handleSubmit = async (e) => {
      e.preventDefault();
      try {
        const response = await axios.post('http://localhost:5000/api/students/register', formData);
        console.log('Registration successful:', response.data);
        alert('Student registered successfully');
      } catch (err) {
        console.error('Error registering student:', err);
        alert('Error occurred while registering');
      }
    };
  
    return (
        <div className="register-container">
            <div className="register-card">
                <h2>Student Registration</h2>
                <form onSubmit={handleSubmit}>
                    <input
                        type="text"
                        placeholder="Student Name"
                        name="name"
                        value={formData.name}
                        onChange={handleChange}
                        className="register-input"
                        required
                    />
                    <input
                        type="text"
                        placeholder="Roll Number"
                        name="rollNo"
                        value={formData.rollNo}
                        onChange={handleChange}
                        className="register-input"
                        required
                    />
                    <input
                        type="date"
                        name="dob"
                        value={formData.dob}
                        onChange={handleChange}
                        className="register-input"
                        required
                    />
                    <input
                        type="text"
                        placeholder="Register Number"
                        name="registerNo"
                        value={formData.registerNo}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Branch"
                        name="branch"
                        value={formData.branch}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Year of Entry"
                        name="yearOfEntry"
                        value={formData.yearOfEntry}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Father's Name"
                        name="fatherName"
                        value={formData.fatherName}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Father's Occupation"
                        name="fatherOccupation"
                        value={formData.fatherOccupation}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Education/Occupation"
                        name="educationOccupation"
                        value={formData.educationOccupation}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <textarea
                        placeholder="Background of Family"
                        name="familyBackground"
                        value={formData.familyBackground}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Parent's Phone Number"
                        name="parentsPhone"
                        value={formData.parentsPhone}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Address"
                        name="address"
                        value={formData.address}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Languages Known"
                        name="languagesKnown"
                        value={formData.languagesKnown}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Guardian's Name (if any)"
                        name="guardianName"
                        value={formData.guardianName}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="School Last Studied"
                        name="schoolName"
                        value={formData.schoolName}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Medium of Instructions in +2"
                        name="mediumOfInstruction"
                        value={formData.mediumOfInstruction}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Marks in +2 - Maths"
                        name="marksMaths"
                        value={formData.marksMaths}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Marks in +2 - Physics"
                        name="marksPhysics"
                        value={formData.marksPhysics}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Marks in +2 - Chemistry"
                        name="marksChemistry"
                        value={formData.marksChemistry}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Cut Off"
                        name="cutOff"
                        value={formData.cutOff}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Quota"
                        name="quota"
                        value={formData.quota}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (1st Year)"
                        name="counsellorNames[0]"
                        value={formData.counsellorNames[0]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (2nd Year)"
                        name="counsellorNames[1]"
                        value={formData.counsellorNames[1]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (3rd Year)"
                        name="counsellorNames[2]"
                        value={formData.counsellorNames[2]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (Final Year)"
                        name="counsellorNames[3]"
                        value={formData.counsellorNames[3]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <button type="submit" className="register-btn">Register Student</button>
                </form>
            </div>
        </div>
    );
}

export default StudentRegister;
